import React, { useState, useEffect } from "react";

import { loadPokedata } from "../api";
const getPokeData = () => {
  const data = loadPokedata();

  return data;
};
const PokeDash = () => {
  const [state, setState] = useState({
    pokeData: {},
  });
  useEffect(() => {
    const pdata = getPokeData();
    setState({ pokeData: pdata });
  }, []);
  return <div className="">{console.log(state.pokeData)}</div>;
};

export default PokeDash;
